import React, {useState} from "react";

function Deck({deck}){

  const result = deck.map(item => (
      <div key={item.id} className="card">
        <div className="card-body">
          <h3 className="card-title">
            {item.name}
          </h3>
          <p className="card-text">
            {item.description}
          </p>
        </div>
        <div className="container">
          <div className="row">
            <button className="col-1 btn btn-secondary">View</button>
            <button className="col-1 btn btn-primary">Study</button>
            <button className="col-8 align-self-end btn btn-danger btn-sm">Delete</button>
          </div>
        </div>
      </div>
  ));

  return(
    <>
      {result}
    </>
  )
}


export default Deck;
